import React from "react";
import Sidebar from "../inc/siderbar";
import { Link } from "react-router-dom";

export default function Dashboard() {
  return (
    <div className="dashboard-container">
      <Sidebar />
      <div className="content">
        <div className="left-text">
          <div className="text-heading">RÉGLAGES ET UTILISATEURS</div>
          <Link to="/" className="mini-heading">
            ACCUEIL
          </Link>
        </div>
        <div className="right-text">
          <div className="text-row">Row 1: Additional Information</div>
          <div className="text-row">Row 2: Further Details</div>
        </div>
      </div>
    </div>
  );
}
